export const types = {
    SET_SUPPORT_MARKER: "SET_SUPPORT_MARKER"
  };
  
  // REDUCERS //
  export const initialState = {
    selSupportGeom: null
  };
  
  export default (state = initialState, action) => {
    switch (action.type) {
      case types.SET_SUPPORT_MARKER:
      alert('called')
        return state;
      default:
        return state;
    }
  };
  
  // ACTIONS //
  export const actions = {
    setSupportMarker: () => ({ type: types.SET_SUPPORT_MARKER })
  };
